import React from 'react';
import { Link } from 'react-router-dom';

class ProjectList extends React.Component{
    constructor(){
        super();
        this.state={
            data:[]
        };
    }

    fetchData(){
        fetch('http://localhost:8000/api/project/')
        .then(response=>response.json())
        .then((data)=>{
            this.setState({
                data:data
            });
        });
    }

    componentDidMount(){
        this.fetchData();
    }

    deleteData(id){
        fetch('http://localhost:8000/api/project/'+id+'/',{
            method:'DELETE',
            body:JSON.stringify(this.state),
        })
        .then(response=>response)
        .then((data)=>{
            if(data){
                this.fetchData();
            }
        });
    }

    render(){
        const BiosampleData=this.state.data;
        const rows=BiosampleData.map((item)=>
            <tr key={item.id}>
                <td>{item.project_name}</td>
                <td>{item.bs_default_project}</td>
                <td>{item.bs_project_id}</td>
                <td>{item.project_type}</td>
                <td>{item.project_created_on}</td>
                <td>{item.bs_user_id}</td>

                <td>
                     {/* <Link to={'/update/'+item.id} className="btn btn-info mr-2">Update</Link>  */}
                    <button onClick={()=>this.deleteData(item.id)} className="btn btn-danger">Delete</button>
                </td>
            </tr>
        );
        return (
            <table className="table table-bordered">
                <Link to='/basespace/projects/addproject'><button>Add</button></Link>
                <thead>
                    <tr>
                        <th>Project Name</th>
                        <th>BS Default Project</th>
                        <th>Bs Projectv ID</th>
                        <th>Project Type</th>
                        <th>Project Created On</th>
                        <th> Bs User Id</th>
                    </tr>
                </thead>
                <tbody>
                    {rows}
                </tbody>
            </table>
        );
    }

}

export default ProjectList;
